import React from "react";
import Matching from "./Matching";
const Slotm = props => {
  // let x = "‚ù§";
  // let y = "‚ù§";
  // let z = "üëç";

  let x = props.x;
  let y = props.y;
  let z = props.z;
  if ((props.x === props.y) && (props.y === props.z)) {
    return <Matching/>
      
    
  } else {
    return (
      <>
        <div>
          <h1>
            {props.x}
            {props.y}
            {z}
          </h1>
          <h1>this is Not Matching</h1>
          <hr />
        </div>
      </>
    );
  }
};
export default Slotm;
